    /**
     * 中台专用加密
     * @param
     * @return
     *
     **/
    public static String encrypt(String str,String key) {
        try {
            byte[] kb = key.getBytes("utf-8");
            SecretKeySpec sks = new SecretKeySpec(kb, "AES");
            //算法/模式/补码方式
            Cipher cipher = Cipher.getInstance("AES/ECB/PKCS5Padding");
            cipher.init(Cipher.ENCRYPT_MODE, sks);
            byte[] eb = cipher.doFinal(str.getBytes("utf-8"));
            return new Base64().encodeToString(eb);
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        }
    }
    /**
     * 中台专用解密
     * @param
     * @return
     *
     **/
    public static String decrypt(String str,String key) {
        try {
            byte[] kb = key.getBytes("utf-8");
            SecretKeySpec sks = new SecretKeySpec(kb, "AES");
            Cipher cipher = Cipher.getInstance("AES/ECB/PKCS5Padding");
            cipher.init(Cipher.DECRYPT_MODE, sks);
            byte[] by = new Base64().decode(str);
            byte[] db = cipher.doFinal(by);
            return new String(db);
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        }
    }
    /**
     * pro专用解密
     *
     * @param encrypted
     * @return
     * @throws Exception
     */
    public static String decryptPro(String encrypted, String key) throws Exception {
        byte[] byteBuf;
        byte[] AES_KEY = key.getBytes(CHARSET);
        try {
            MessageDigest md = MessageDigest.getInstance("MD5");
            byte[] digestBuf = md.digest(AES_KEY);
            SecretKeySpec skey = new SecretKeySpec(digestBuf, "AES");
            Cipher decipher = Cipher.getInstance("AES");
            decipher.init(Cipher.DECRYPT_MODE, skey);
            byteBuf = decipher.doFinal(toByte(encrypted));
        } catch (Exception ex) {
            throw new RuntimeException("aes解密异常", ex);
        }
        return new String(byteBuf, CHARSET);
    }

    /**
     * pro专用加密
     *
     * @param content
     * @param key
     * @return
     * @throws Exception
     */
    public static String encryptPro(String content, String key) {
        try {
            byte[] input = content.getBytes(CHARSET);
            MessageDigest md = MessageDigest.getInstance("MD5");
            byte[] digestBuf = md.digest(key.getBytes(CHARSET));
            SecretKeySpec skc = new SecretKeySpec(digestBuf, "AES");
            Cipher cipher = Cipher.getInstance("AES/ECB/PKCS5Padding");
            cipher.init(Cipher.ENCRYPT_MODE, skc);
            byte[] cipherText = new byte[cipher.getOutputSize(input.length)];
            int ctLength = cipher.update(input, 0, input.length, cipherText, 0);
            cipher.doFinal(cipherText, ctLength);
            return parseByte2HexStr(cipherText);
        } catch (Exception ex) {
            throw new RuntimeException("aes加密异常", ex);
        }
    }

    /**
     * 字符串转字节数组
     *
     * @param hexString
     * @return
     */
    private static byte[] toByte(String hexString) {
        int len = hexString.length() / 2;
        byte[] result = new byte[len];
        for (int i = 0; i < len; i++) {
            result[i] = Integer.valueOf(hexString.substring(2 * i, 2 * i + 2), 16).byteValue();
        }
        return result;
    }

    /**
     * 字节转16进制数组
     *
     * @param buf
     * @return
     */
    private static String parseByte2HexStr(byte[] buf) {
        StringBuffer sb = new StringBuffer();
        for (int i = 0; i < buf.length; i++) {
            String hex = Integer.toHexString(buf[i] & 0xFF);
            if (hex.length() == 1) {
                hex = '0' + hex;
            }
            sb.append(hex);
        }
        return sb.toString();
    }

